import React, { Component } from 'react'

export class Message extends Component {
    render() {
        return (
            <div>
                {
                    this.props.users.filter(
                        user => {
                            return user.active    
                        }
                    )[0].firstName}

                <h3 style={{color: "white"}}>Test Message</h3>
            </div>
        )
    }
}

export default Message
